import React from 'react';
import { BrowserRouter, Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';
import Sidebar from './defultComponent/sidebar';
import RouterA from './defultComponent/router';
import { ProSidebar } from 'react-pro-sidebar';

export default function App() {
  return (
    <>
    <BrowserRouter>
      <nav>
        <ul>
          <li>
            <Link to="/"></Link>
          </li>
        </ul>
      </nav>
      <Router>
        <Routes>
          <Route path='/' element={Sidebar} />
          <Route path='/menu' />
        </Routes>
      </Router>
    </BrowserRouter>
    </>
  )
}
